import React from "react";
import {Box} from "@mui/material";
import theme from "../utils/theme"
const Footer = ()=>{
  return <Box maxWidth="lg" height="374px" bgcolor={theme.color.primary}>
    <Box m="0 auto" display="flex" flexDirection="row">
      <Box flexGrow="1"></Box>
      <Box flexGrow="1"></Box>
    </Box>
  </Box>

} 

export default Footer;
